script: |
  super -f text -I q756.spq | sort > q756.out

inputs:
  - name: q756.spq
    data: |
      SELECT - col2 * + 41 / - - 48 + ( + - 41 ) + - - col2 / + 52 * + col0 * - col1 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE - col1 BETWEEN - col0 AND - 86;
  - name: tab1

outputs:
  - name: q756.out
    data: |
